import {
    NgForm, FormGroup, FormControl,
    Validators, FormBuilder
} from "@angular/forms";

export class Patient {
    id: number = 0;
    name: string = "";
    age: number = 0;
    code: String = "";

    formPatientGroup: FormGroup = null;
    constructor() {

        var _builder = new FormBuilder();
        this.formPatientGroup = _builder.group({});


    }


}
